import './TopBar.css'; // Import the CSS file for styling

const TopBar = () => {
  return (
    <div className="top-bar">
      <div className="logo">Logo</div>
      <ul className="menu">
        <li>+1 234 5678 910</li>
        <li>demo@example.com</li>
        <li>Login  |  <span>Sign Up</span></li>
      </ul>
    </div>
  );
};

export default TopBar;
